00050     public CompilationUnit Parse()
00051     {
00052         while (true)
00053         {
00054             var consumedToken = _tokenWalker.Consume();
00055 
00056             switch (consumedToken.SyntaxKind)
00057             {
00058                 case SyntaxKind.AssociatedNameToken:
00059                     ParseAssociatedNameToken((AssociatedNameToken)consumedToken);
00060                     break;
00061                 case SyntaxKind.AssociatedValueToken:
00062                     ParseAssociatedValueToken((AssociatedValueToken)consumedToken);
00063                     break;
00064                 case SyntaxKind.OpenAssociatedGroupToken:
00065                     ParseOpenAssociatedGroupToken((OpenAssociatedGroupToken)consumedToken);
00066                     break;
00067                 case SyntaxKind.CloseAssociatedGroupToken:
00068                     ParseCloseAssociatedGroupToken((CloseAssociatedGroupToken)consumedToken);
00069                     break;
00070                 default:
00071                     break;
00072             }
00073 
00074             if (consumedToken.SyntaxKind == SyntaxKind.EndOfFileToken)
00075                 break;
00076         }
00077 
00078         var globalSectionNestedProjects = DotNetSolutionGlobal.DotNetSolutionGlobalSectionList.FirstOrDefault(x =>
00079         {
00080             return (x.GlobalSectionArgument?.TextSpan.GetText() ?? string.Empty) == 
00081                 LexSolutionFacts.GlobalSectionNestedProjects.START_TOKEN;
00082         });
00083 
00084         if (globalSectionNestedProjects is not null)
00085         {
00086             foreach (var associatedEntry in globalSectionNestedProjects.AssociatedEntryGroup.AssociatedEntryList)
00087             {
00088                 switch (associatedEntry.AssociatedEntryKind)
00089                 {
00090                     case AssociatedEntryKind.Pair:
00091                         var pair = (AssociatedEntryPair)associatedEntry;
00092 
00093                         if (Guid.TryParse(pair.AssociatedNameToken.TextSpan.GetText(),
00094                                 out var childProjectIdGuid))
00095                         {
00096                             if (Guid.TryParse(pair.AssociatedValueToken.TextSpan.GetText(),
00097                                     out var solutionFolderIdGuid))
00098                             {
00099                                 var nestedProjectEntry = new NestedProjectEntry(
00100                                     childProjectIdGuid,
00101                                     solutionFolderIdGuid);
00102 
00103                                 _nestedProjectEntryList.Add(nestedProjectEntry);
00104                             }
00105                         }
00106 
00107                         break;
00108                     default:
00109                         break;
00110                 }
00111             }
00112         }
00113 
00114         return new CompilationUnit(
00115             null,
00116             Lexer,
00117             this,
00118             null);
00119     }
