00121     public void ParseAssociatedNameToken(AssociatedNameToken associatedNameToken)
00122     {
00123         if (!_hasReadHeader)
00124         {
00125             foreach (var wellKnownAssociatedName in LexSolutionFacts.Header.WellKnownAssociatedNamesList)
00126             {
00127                 if (associatedNameToken.TextSpan.GetText() == wellKnownAssociatedName)
00128                 {
00129                     var associatedValueToken = (AssociatedValueToken)_tokenWalker.Match(SyntaxKind.AssociatedValueToken);
00130 
00131                     switch (wellKnownAssociatedName)
00132                     {
00133                         case LexSolutionFacts.Header.EXACT_VISUAL_STUDIO_VERSION_START_TOKEN:
00134                             _dotNetSolutionHeader = _dotNetSolutionHeader with
00135                             {
00136                                 ExactVisualStudioVersionPair = new AssociatedEntryPair(
00137                                     associatedNameToken, associatedValueToken),
00138                             };
00139                             break;
00140                         case LexSolutionFacts.Header.FORMAT_VERSION_START_TOKEN:
00141                             _dotNetSolutionHeader = _dotNetSolutionHeader with
00142                             {
00143                                 FormatVersionPair = new AssociatedEntryPair(
00144                                     associatedNameToken, associatedValueToken),
00145                             };
00146                             break;
00147                         case LexSolutionFacts.Header.HASHTAG_VISUAL_STUDIO_VERSION_START_TOKEN:
00148                             _dotNetSolutionHeader = _dotNetSolutionHeader with
00149                             {
00150                                 HashtagVisualStudioVersionPair = new AssociatedEntryPair(
00151                                     associatedNameToken, associatedValueToken),
00152                             };
00153                             break;
00154                         case LexSolutionFacts.Header.MINIMUM_VISUAL_STUDIO_VERSION_START_TOKEN:
00155                             _dotNetSolutionHeader = _dotNetSolutionHeader with
00156                             {
00157                                 MinimumVisualStudioVersionPair = new AssociatedEntryPair(
00158                                     associatedNameToken, associatedValueToken),
00159                             };
00160                             break;
00161                     }
00162                 }
00163             }
00164         }
00165         else
00166         {
00167             var associatedValueToken = (AssociatedValueToken)_tokenWalker.Match(SyntaxKind.AssociatedValueToken);
00168             var associatedEntryPair = new AssociatedEntryPair(associatedNameToken, associatedValueToken);
00169 
00170             _associatedEntryGroupBuilderStack.Peek().AssociatedEntryList.Add(associatedEntryPair);
00171         }
00172     }
