00174     public void ParseAssociatedValueToken(AssociatedValueToken associatedValueToken)
00175     {
00176         // One enters this method when parsing the Project definitions.
00177         // They are one value after another, no names involved.
00178 
00179         var associatedEntryPair = new AssociatedEntryPair(
00180             new AssociatedNameToken(TextEditorTextSpan.FabricateTextSpan(string.Empty)),
00181             associatedValueToken);
00182 
00183         _associatedEntryGroupBuilderStack.Peek().AssociatedEntryList.Add(associatedEntryPair);
00184     }
