00186     private void ParseOpenAssociatedGroupToken(OpenAssociatedGroupToken openAssociatedGroupToken)
00187     {
00188         // Presumption is made here, that the header only contains AssociatedEntryPairs
00189         _hasReadHeader = true;
00190 
00191         var success = _associatedEntryGroupBuilderStack.TryPeek(out var parent);
00192 
00193         if (openAssociatedGroupToken.TextSpan.GetText() == LexSolutionFacts.Global.START_TOKEN)
00194         {
00195             _dotNetSolutionGlobal = _dotNetSolutionGlobal with
00196             {
00197                 WasFound = true,
00198                 OpenAssociatedGroupToken = openAssociatedGroupToken
00199             };
00200         }
00201         else if (openAssociatedGroupToken.TextSpan.GetText() == LexSolutionFacts.GlobalSection.START_TOKEN)
00202         {
00203             // TODO: Should this be re-written without using a closure hack?
00204             var localDotNetSolutionGlobalSectionBuilder = new DotNetSolutionGlobalSectionBuilder();
00205 
00206             _associatedEntryGroupBuilderStack.Push(new AssociatedEntryGroupBuilder(
00207                 openAssociatedGroupToken,
00208                 builtGroup =>
00209                 {
00210                     localDotNetSolutionGlobalSectionBuilder.AssociatedEntryGroup = builtGroup;
00211 
00212                     var outList = _dotNetSolutionGlobal.DotNetSolutionGlobalSectionList.Add(
00213                         localDotNetSolutionGlobalSectionBuilder.Build());
00214 
00215                     _dotNetSolutionGlobal = _dotNetSolutionGlobal with
00216                     {
00217                         DotNetSolutionGlobalSectionList = outList
00218                     };
00219                 }));
00220 
00221             localDotNetSolutionGlobalSectionBuilder.GlobalSectionArgument =
00222                 (AssociatedValueToken)_tokenWalker.Match(SyntaxKind.AssociatedValueToken);
00223 
00224             localDotNetSolutionGlobalSectionBuilder.GlobalSectionOrder =
00225                 (AssociatedValueToken)_tokenWalker.Match(SyntaxKind.AssociatedValueToken);
00226         }
00227         else if (openAssociatedGroupToken.TextSpan.GetText() == LexSolutionFacts.Project.PROJECT_DEFINITION_START_TOKEN)
00228         {
00229             _associatedEntryGroupBuilderStack.Push(new AssociatedEntryGroupBuilder(
00230                 openAssociatedGroupToken,
00231                 builtGroup =>
00232                 {
00233                     if (builtGroup.AssociatedEntryList.Length == 4)
00234                     {
00235                         var i = 0;
00236 
00237                         var projectTypeGuidAssociatedPair = builtGroup.AssociatedEntryList[i++] as AssociatedEntryPair;
00238                         var displayNameAssociatedPair = builtGroup.AssociatedEntryList[i++] as AssociatedEntryPair;
00239                         var relativePathFromSolutionFileStringAssociatedPair = builtGroup.AssociatedEntryList[i++] as AssociatedEntryPair;
00240                         var projectIdGuidAssociatedPair = builtGroup.AssociatedEntryList[i++] as AssociatedEntryPair;
00241 
00242                         _ = Guid.TryParse(projectTypeGuidAssociatedPair.AssociatedValueToken.TextSpan.GetText(), out var projectTypeGuid);
00243                         var displayName = displayNameAssociatedPair.AssociatedValueToken.TextSpan.GetText();
00244                         var relativePathFromSolutionFileString = relativePathFromSolutionFileStringAssociatedPair.AssociatedValueToken.TextSpan.GetText();
00245                         _ = Guid.TryParse(projectIdGuidAssociatedPair.AssociatedValueToken.TextSpan.GetText(), out var projectIdGuid);
00246 
00247                         IDotNetProject dotNetProject;
00248 
00249                         if (projectTypeGuid == SolutionFolder.SolutionFolderProjectTypeGuid)
00250                         {
00251                             dotNetProject = new SolutionFolder(
00252                                 displayName,
00253                                 projectTypeGuid,
00254                                 relativePathFromSolutionFileString,
00255                                 projectIdGuid,
00256                                 builtGroup.OpenAssociatedGroupToken,
00257                                 builtGroup.CloseAssociatedGroupToken,
00258                                 null);
00259                         }
00260                         else
00261                         {
00262                             dotNetProject = new CSharpProjectModel(
00263                                 displayName,
00264                                 projectTypeGuid,
00265                                 relativePathFromSolutionFileString,
00266                                 projectIdGuid,
00267                                 builtGroup.OpenAssociatedGroupToken,
00268                                 builtGroup.CloseAssociatedGroupToken,
00269                                 null);
00270                         }
00271 
00272                         _dotNetProjectList.Add(dotNetProject);
00273                     }
00274 
00275                     _noParentHavingAssociatedEntryGroup = builtGroup;
00276                 }));
00277         }
00278         else if (parent is not null)
00279         {
00280             _associatedEntryGroupBuilderStack.Push(new AssociatedEntryGroupBuilder(
00281                 openAssociatedGroupToken,
00282                 builtGroup =>
00283                 {
00284                     parent.AssociatedEntryList.Add(builtGroup);
00285                 }));
00286         }
00287     }
