00289     private void ParseCloseAssociatedGroupToken(CloseAssociatedGroupToken closeAssociatedGroupToken)
00290     {
00291         if (closeAssociatedGroupToken.TextSpan.GetText() == LexSolutionFacts.Global.END_TOKEN)
00292         {
00293             _dotNetSolutionGlobal = _dotNetSolutionGlobal with
00294             {
00295                 CloseAssociatedGroupToken = closeAssociatedGroupToken
00296             };
00297         }
00298         else if (closeAssociatedGroupToken.TextSpan.GetText() == LexSolutionFacts.GlobalSection.END_TOKEN)
00299         {
00300             var associatedEntryGroupBuilder = _associatedEntryGroupBuilderStack.Pop();
00301             associatedEntryGroupBuilder.CloseAssociatedGroupToken = closeAssociatedGroupToken;
00302 
00303             associatedEntryGroupBuilder.Build();
00304         }
00305         else
00306         {
00307             var associatedEntryGroupBuilder = _associatedEntryGroupBuilderStack.Pop();
00308             associatedEntryGroupBuilder.CloseAssociatedGroupToken = closeAssociatedGroupToken;
00309 
00310             associatedEntryGroupBuilder.Build();
00311         }
00312     }
